import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

const ProtectedRouting = (props) => {
    const navigate = useNavigate();
    useEffect(()=>{
        const isGet= localStorage.getItem('Register');
        if(!isGet){
            navigate('/Register');
        }

    },[navigate]
    )
  return (
    <div><props.home/></div>
  )
}

export default ProtectedRouting
